  }

  render () {
      return (
        <span>
          <div id="hero">
            <Container>
              <div id="hero-inner">
                <h1>What type of experience are you looking for?</h1>
                <Search />
              </div>
            </Container>
          </div>

          <Container id="below">
            <Row>
              <Col size={4}>
                <h3>Title 1</h3>
