              </Col>
              <Col size={4}>
                Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industrys standard dummy text ever since the 1500s, when an unknown printer took a galley of type.
              </Col>
            </Row>
          </Container>

        </span>
      )
   }
}
